function Main(props){
    let lgt=useNavigate();


function Logout(){ 

    localStorage.removeItem('auth');
    localStorage.removeItem('token');
    lgt('/');

 }

 
 
    return(
        <div>
    
         
         <Header login='Logout'  sidebar='mainsidebar' home='Home' loginfont='fa fa-usd' navi={Logout}  />

        </div>
    );
}

export default Main;
